Traits are abstract data types containing certain fields and methods. They can be defined using the trait keyword. In Scala inheritance, a class can only extend one other class, but it can extend multiple traits. trait Greeter { def greet(name: String): Unit
} defined trait Greeter Traits can have default implementations also. trait Greeter { def greet(name: String): Unit = println("Hello, " + name + "!")
