Resilient distributed datasets (RDDs) are the primary abstraction in Spark. RDDs are immutable once created: can transform it. can perform actions on it. but cannot change an RDD once you construct it. Spark tracks each RDD's lineage information or recipe to enable its efficient recomputation if a machine fails. RDDs enable operations on collections of elements in parallel. We can construct RDDs by: parallelizing Scala collections such as lists or arrays by transforming an existing RDD, from files in distributed file systems such as (HDFS, S3, etc.). We can specify the number of partitions for an RDD The more partitions in an RDD, the more opportunities for parallelism There are two types of operations you can perform on an RDD: transformations (are lazily evaluated) map flatMap filter distinct ... actions (actual evaluation happens) count reduce take collect takeOrdered ... Spark transformations enable us to create new RDDs from an existing RDD. RDD transformations are lazy evaluations (results are not computed right away) Spark remembers the set of transformations that are applied to a base data set (this is the lineage graph of RDD) The allows Spark to automatically recover RDDs from failures and slow workers. The lineage graph is a recipe for creating a result and it can be optimized before execution. A transformed RDD is executed only when an action runs on it. You can also persist, or cache, RDDs in memory or on disk (this speeds up iterative ML algorithms that transforms the initial RDD iteratively). Here is a great reference URL for programming guides for Spark that one should try to cover first http://spark.apache.org/docs/latest/programming-guide.html . and specifically for RDDs: https://spark.apache.org/docs/latest/rdd-programming-guide.html //This allows easy embedding of publicly available information into any other notebook
